import React from "react";
import style from "./person.module.css";

function Person(props) {
  const {
    image,
    name,
    title,
    id,
    country,
    report,
    check,
    emails,
    phones,
    social,
    nickname,
    education,
  } = props;
  return (
    <div className="container">
      <div className="row justify-content-center">
        <div className={style.profile}>
          <div className={style.halfBackground}></div>
          {/* כאן יגיע json של התמונה  */}
          <img
            src="https://imgtr.ee/image/I5ud45"
            alt={name}
            className={style.profileImage}
          />
        </div>
        {/* JSON של השם והטייטל יגיע כאן */}
        <div className={style["info754"]}>
          <h2>ברוס ויין</h2>
          <p>Founder & CEO at RedCamel Solutions Ltd גיבור על</p>
        </div>
        {/*JSON עם הת.ז והמדינה יגיע כאן*/}
        <div className={style["state2"]}>ת.ז 023393633 | ישראל</div>
        <div>
          <p></p>
          
        </div>
      </div>
    </div>
  );
}

export default Person;
